@anoopsharma00 , @venkat1m @zellerh 
Let me explain this PR: it is pure for user friendly change. The rows returned message is part of the 'header' message, so if no header option spefied, that message will not display as well. So you can think it as an extension to the header display information.
This will be useful at field. For example, after running a script to create huge amount of tables, it will be good to validate the number of tables created successfully. This may not look like a common operation, but this is a true use case. I am in that project and at field. We are required to write DDL in a very short time to create 30+ tables and external tables and indexes. Run a script, and want to check how many tables created, and found this 'issue', so it is something sometimes really helpful.
